import React from 'react'
import Note from './Compnents/Note'

const App = ({notes}) => {

  return (
    <div>
      <h1>Notes</h1>
      <ul>
        {notes.map(note => 
          <Note {...note} />
        )}
      </ul>
    </div>
  )
}

export default App
